import React from "react"
import { Table } from "react-bootstrap"

function PatientInformationTable(props) {
    let infoArray = []
    const patientInfoObject = JSON.parse(props.patientObj)
    function infoObjToArr (obj) {
        for (const key in obj) {
            infoArray.push(obj[key])
        }
        console.log(infoArray)
    }

    if (props.patientObj.length) {
        infoObjToArr(patientInfoObject)
    }

    // console.log(patientInfoObject)

    return (
        <Table striped bordered >
            <thead>
                <tr>
                    <th>Age</th>
                    <th>Sex</th>
                    <th>Chief Complaint</th>
                    <th>MOI/HPI</th>
                    <th>O2 Treatment</th>
                    <th>From</th>
                </tr>
            </thead>
            <tbody>
                {infoArray.map(info =>
                    <tr>
                        <td>{info.age}</td>
                        <td>{info.sex}</td>
                        <td>{info.chiefComplaint}</td>
                        <td>{info.moiHpi}</td>
                        <td>{info.oxygenTx}</td>
                        <td>{info.from}</td>
                    </tr>
                )}
            </tbody>
        </Table>
    )
}

export default PatientInformationTable
